import React, {Component} from 'react';

class Login extends Component{

    reg = new RegExp("^[a-z0-9]+([._\\-]*[a-z0-9])*@([a-z0-9]+[-a-z0-9]*[a-z0-9]+.){1,63}[a-z0-9]+$");
    state = {
        name: "",
        password: "",
        email: "",
    }

    emailHandler(e){
        this.setState({
            email: e.target.value
        })
    }

    passwordHandler(e){
        this.setState({
            password: e.target.value
        })
    }

    render(){
        return (
            <div className="login-container form-container">
                <form action="#">
                    <h1>Sign in</h1>
                    <div className="social-container">
                        <a href="#" className="social"><i className="fa fa-facebook-official"></i></a>
                        <a href="#" className="social"><i className="fa fa-google"></i></a>
                        <a href="#" className="social"><i className="fa fa-github"></i></a>
                    </div>
                    <span>Sign in with your email</span>
                    <input type="email" placeholder="Email"/>
                    <input type="password" placeholder="Password"/>
                    <button>Sign In</button>
                </form>
            </div>
        );
    }
}

export default Login;
